import React from 'react';
import { useNavigate } from 'react-router-dom';

function AuthForm() {
    const navigate = useNavigate();

    const handleLogin = () => {
        // Aqui você pode adicionar validação de login
        navigate('/dashboard');
    };

    return (
        <div className="auth-container">
            <h1 className="title">Pizzaria do JayJay</h1>
            <h2 className="subtitle">Login</h2>
            <div className="form-container">
                <div className="form-group">
                    <label htmlFor="username">Nome de Usuário ou Email</label>
                    <input id="username" type="text" className="input-field" />
                </div>
                <div className="form-group">
                    <label htmlFor="password">Senha</label>
                    <input id="password" type="password" className="input-field" />
                </div>
                <button className="btn-signin" onClick={handleLogin}>Entrar</button>
                <div className="divider">
                    <p className="new-account">Novo por aqui? <a href="#" className="link">Crie uma conta</a></p>
                </div>
            </div>
        </div>
    );
}

export default AuthForm;
